INSERT INTO `language` VALUES ('birthday','Geburtsdatum','Birthday','birthday','birthday'),('categories','Kategorien','categories','Categorías','Kategorijama'),('clubRankingBtn','30K Club Ranking','30K Club Ranking','30K Club Clasificación','30K Rang lista klubova'),('clubRankingEmailNameBtn','Lade Email-Name Liste','download email-name list','Descaqrgar Email-Nombre Lista','Unesi Email – Ime listu'),('clubRankingHeadline','30K Club Ranking Liste','30K Club ranking list','30K Lista de clasificación clubs','30K Klupska rang lista'),('createClub','Neuen Club erstellen','Create New Club','Create New Club','Create New Club'),('distanceBackBtn','Schritt zurück','step back','Retroceder','Korak natrag'),('distanceBtn','Distanz hochladen','Upload distance','Distancia Subir','Unesi izveslanu distancu'),('distanceClubErrorThree','Excel Daten ungültig','excel data invalid','Los datos de Excel no son válidos','Greška u Excel tablici'),('distanceClubHeadlineOne','Überprüfen Sie die Struktur','check the structure','Comprobar la estructura','Provjeriti podatke'),('distanceClubHeadlineTwo','Wählen Sie die Datei aus','choose file','Selecciona el archivo','Odabrati podatke'),('distanceClubSelectTwo','Wähle Excel Datei','choose excel file','Seleccione el archivo de Excel','Odabrati Excel file'),('distanceClubSubheadlineOne','So soll die Excel Tabelle aussehen (.xlsx Format)','this is how the excel file should look like (.xlsx format)','Así es como debería verse la hoja de cálculo de Excel. (.xlsx Format)','Ovako bi trebala izgledati Excel tablica (.xlsx format)'),('distanceClubSubmitOne','Verstanden','understood','Entendido','Razumijem & slažem se'),('distanceClubSuccessThree','Ihre Excel Datei wurde erfolgreich hochgeladen','your excel file was successfully uploaded to the server','Tu archivo de Excel ha sido subido exitosamente','Vaši podaci su uspješno snimljeni'),('distanceHeadlineThree','Hochladen zum Server','upload to server','Subir al servidor','Snimiti na server'),('distanceParticipantErrorMsg','Ungültige Distanz','invalid distance','Distancia inválida','Greška prilikom unošenja izveslane distance'),('distanceParticipantHeadlineOne','Tragen Sie die erreichte Distanz ein','enter your reached distance','Introduce la distancia alcanzada','Unesite izveslanu duljinu'),('distanceParticipantHeadlineTwo','Wählen Sie das Beweisbild aus','choose your proof photo','Seleccione la imagen de prueba','Odabrati fotografiju (display na ergometru)'),('distanceParticipantSelectionTwo','Beweisbild auswählen','choose proof photo','imagen de prueba','Odabrati fotografiju (display na ergometru)'),('distanceParticipantSubheadlineOne','Distanz','distance','Distancia','Izveslana dsitanca'),('distanceParticipantSuccessThree','Ihre Distanz wurde erfolgreich hochgeladen','your distance was successfully uploaded','Tu distancia ha sido subida exitosamente','Vaša izveslana daljina je uspješno snimljena'),('distanceSubmitBtn','Weiter','continue','Además','Dalje'),('editHeader','Persönliche Daten bearbeiten','Edit personal data','Edit personal data','Edit personal data'),('ergoBtn','Ergo Challenge','Ergo Challenge','Ergo Reto','Ergo Challenge'),('ergoHeadline','30 (dirty) K Ergo Challenge','30 (dirty) K Ergo Challenge','30 (dirty) K Ergo Challenge','30 (dirty) K Ergo Challenge'),('ergoSubheadlineFour','Daten','data','datos','Podaci'),('ergoSubheadlineOne','Allgemeines','General','En General','Razno'),('ergoSubheadlineThree','Ziel','Objectiv','Objectivo','Cilj'),('ergoSubheadlineTwo','Bewerb','Competition','El Evento','Natjecanje'),('ergoTextFour','Um an der Challenge teilnehmen zu können, muss man sich mit einer E-Mail auf dieser Website registrieren und weitere persönliche Daten wie Name, Alter, Gewicht, etc. für die Auswertung der Challenge angeben (Das Gewicht dient lediglich zur Berechnung und scheint nicht in der Auswertung auf). Ihre Daten werden vertraulich gespeichert und nicht an Dritte weitergegeben. Bei Fragen wenden Sie sich an challenge@ister.at. Die Reihung erfolgt gemäß der Concept2 Alterseinteilung:','In order to participate in the Challenge, you must register with an e-mail on this website and provide other personal information such as name, age, weight, etc. for the evaluation of the results (The weight is for calculation only and does not appear in the ranking). Your data will be stored confidentially and will not be passed on to third parties. If you have any questions, please contact challenge@ister.at. The ranking is according to the Concept2 age classification:','Para participar en el Reto, debe registrarse con un correo electrónico en este sitio web y proporcionar otra información personal como nombre, edad, peso, etc. para la evaluación del Reto (el peso es solo para el cálculo y no aparece en la evaluación en). Sus datos se almacenarán de forma confidencial y no se transmitirán a terceros. Si tiene alguna pregunta, póngase en contacto con challenge@ister.at. La clasificación de entrantes individuales se realiza de acuerdo a la clasificación edad Concept 2.:','Da bi se rezultati bili postavljeni na listu, potrebni su sljedeći podaci: ime i prezime, godina rođenja, težina i fotografija zaslona ergometra sa rezultatom na adresu E-Mail: challenge@ister.at. Podaci se ne prosljeđuju. Težina se ne objavljuju nego služi za izračunavanje W/kg. Rang lista se radi na osnovu Concept2 starosnih kategorija:'),('ergoTextFourClasslist','SchülerInnen: bis 14 Jahre;JuniorenInnen: 15 – 16 Jahre;JuniorenInnen: 17 – 18 Jahre;Allgemeine Klasse: 19 – 29 Jahre;Masters A: 30 – 39 Jahre;Masters B: 40 – 49 Jahre;Masters C: 50 – 59 Jahre;Masters D: 60 – 69 Jahre;Masters E: 70 – 79 Jahre;Masters F: 80 – 89 Jahre','Students: up to 14 years; Juniors B: 15-16 years; Juniors A: 17-18 years; General Class: 19-29 years; Masters A: 30-39 years; Masters B: 40-49 years; Masters C: 50-59 years; Masters D: 60 - 69 years; Masters E: 70 - 79 years; Masters F: 80 - 89 years','Alumnos: hasta 14 años;Junior B: 15 – 16 años;Junior A: 17 – 18 Jahre;Clase èlite: 19 – 29 años;Masters A: 30 – 39 años;Masters B: 40 – 49 años;Masters C: 50 – 59 años;Masters D: 60 – 69 años;Masters E: 70 – 79 años;Masters F: 80 – 89 años','Kadeti: do 14 godina;Juniori/ke B: 15 – 16 godina;Juniori/ke: 17 – 18 godina;Otvorena klasa: 19 – 29 godina;Masters A: 30 – 39 godina;Masters B: 40 – 49 godina;Masters C: 50 – 59 godina;Masters D: 60 – 69 godina;Masters E: 70 – 79 godina;Masters F: 80 – 89 godina'),('ergoTextOne','Bei diesem Bewerb gibt es weder etwas zu gewinnen, noch erhält man eine Medaille. Alle Ruderer, weiblich und männlich aus Vereinen oder privat, sind startberechtigt und als Administrator vertrauen wir auf die Richtigkeit der gelieferten Daten.','There is nothing to win in this competition, nor do you get a medal. All rowers, male and female from clubs or private, are eligible to start and as an administrator, we trust in the correctness of the data provided.','En esta competición, ni hay algo de ganar, ni se obtiene una medalla.  Todos los remeros, hombres y mujeres de los clubes o privadas, son elegibles y como administrador estoye confío en la exactitud de los datos suministrados.','Ovo je virtualno natjecanje, ne postoje nagrade niti medalje. Pravo sudjelovanja imaju svi veslači, muški, ženski;  bilo kao članovi kluba ili samostalno. Svi dostavljeni rezultati biti će obrađeni u dobroj vjeri u fair-play.'),('ergoTextThree','Bei vier Termine zusammengerechnet, mindestens 30 000 Meter (Männer) oder 26 000 (Frauen) zu rudern und dabei mit Ruderkollegen aus Österreich und der Welt messen.','At four appointments totaled, at least 30 000 meters (men) or 26 000 (women) to row and thereby compete with rowing colleagues from Austria and the world.','En cuatro fechas suman, al menos 30.000 metros (hombres) o 26 000 (mujeres) a la fila y miden con los colegas de remo de Austria y el mundo.','U 4 termina izveslati barem 30000m (muški) ili 26000m (žene) i tako se virtualno takmičiti sa ostalim veslačima iz Austrije i cijelog svijeta.'),('ergoTextTwo','Die Teilnehmer sollen versuchen in der Zeit von 30 Minuten so viele Meter am Ergometer zurück zu legen, als es ihnen möglich ist. Es gibt über den Winter verteilt sechs (6) Termine, wobei die vier (4) besten Ergebnisse gewertet werden. Die Termine sind immer von Donnerstag 18:00 Uhr bis Montag 18:00 Uhr berechnet:','The participants should try to put as many meters back on the ergometer in 30 minutes time as they can. There are six (6) events over the winter, with four (4) best results scored. The dates are always held from Thursday 18:00 to Monday 18:00:','Los participantes deben que remo mas metros como es posible con el C2 ergómetro en el tiempo de 30 minutos. Durante el invierno hay de seis (6) periodos, los cuatro (4) mejores resultados se cuentan. Los resultados se añaden cada mes. Las fechas siempre se calculan a partir del jueves a lunes 18:00 a 18:00.','Cilj natjecanja je izveslati što više metara na ergometru u 30 minuta. Postoji 6 termina (obično zadnji vikend u mjesecu; od listopada do ožujka). Za svaki termin postoji rang lista. Za sudjelovanje u ukupnoj rang listi obavezno je veslati 4 od 6 mogućih termina. Ako je izveslano 5 ili 6 termina bodovaće se 4 najbolja rezultata. Termin uvijek počinje u četvrtak u 18:00 i traje do ponedjeljka do 18:00'),('existingClub','Vorhandenen übernehmen','Take over existing','Take over existing','Take over existing'),('female','weiblich','female','femininio','ženski'),('firstName','Vorname','First name','First name','First name'),('gender','Geschlecht','Gender','Gender','Gender'),('headerCountdown','DIE CHALLENGE','THE CHALLENGE','El Desasfío','Challenge'),('headerDay','Tage','days','Dia','Dani'),('headerEnds','ENDET','ENDS','TERMINO','NA KRAJU'),('headerHour','Stunden','hours','Hora','Sati'),('headerMinutes','Minuten','minutes','Minutos','Minuti'),('headerSeconds','Sekunden','seconds','Secundos','Sekunde'),('headerStarts','STARTET','STARTS','COMIENZO','NA STARTU'),('homeBtn','Start','Start','Comienzo','Start'),('homeHeadline','Willkommen zur ERGO-Challenge Seite des Linzer Rudervereins ISTER','Welcome to the ERGO-Challenge page of the ISTER Linz rowing club','Bienvenido a la página de ERGO Challenge (desafío) del club de remo ISTER Linz','Dobro došli na Website ERGO-Challenge (Veslački klub ISTER, Linz)'),('homeTextOne','Breitensport und Rennsport bestehen schon lange nebeneinander, oft jedoch teilt dieser Umstand die Mitglieder im Verein. Bei einer Challenge kann jeder, unabhängig von dieser Zuordnung teilnehmen. Bei den Reihungen in den Ergebnislisten findet man sich in bekannter Gesellschaft von Freunden, Bekannten oder auch Neueinsteigern verschiedenster Vereine.','Mass sport and top-class sport have existed side by side for a long time. Often, however, this circumstance parts the members in a club. In a Challenge, everybody can take part no matter these circumstances. In the rankings you will find yourself alongside friends, acquaintance and newcomers of different clubs all over the world.','El deporte de base y las carreras han existido durante mucho tiempo, pero a menudo esta circunstancia comparte a los miembros del club. Cualquiera puede participar en un desafío sin importar esta tarea. En las clasificaciones de los resultados encontrará en una compañía conocida de amigos, conocidos o recién llegados de varios clubes.','Reakreativni i takmičarski sport već dugo postoje jedno pored drugog, pa ipak ta podjela obično segregira veslače. Postoji jedan „Challenge“, u kojem, neovisno o ovoj podjeli, mogu učestvovati svi veslači. U Challenge rang listu nalazi se puno prijatelja, poznanika, početnika iz svog ili iz drugih klubova.'),('homeTextThree','Als veranstaltender Verein „Linzer Ruderverein ISTER“ haben diese Veranstaltungen natürlich Bezug zum Rudern, insbesondere die Winterchallenge an den Concept2 Ergometern wird auch an die Fitness Clubs getragen.','As organizing club \"Linzer Ruderverein ISTER\", these events are of course related to rowing, especially the winter challenges at the Concept2 ergometers are also announced to fitness clubs.','Por supuesto, como club organizador \"Linzer Ruderverein ISTER\", estos eventos están relacionados con el remo, especialmente el desafío del invierno 30K Ergo-Challenge \"Dirty Thirty\", el desafío \"Dirty Dozen\" y el desafío \"Sexy Six\" en los ergómetros Concept2. Estos eventos también se llevan a cabo en los clubes de fitness. Si quieres estar allí, un mensaje de correo electrónico es suficiente.','Organizator veslački klub ISTER iz Linza, organizira Challenge tijekom zime, kada obično vesla „miruju“ a „vrti“ se C2 Ergometar. C2 su vrlo česti i u fitness dvoranama.'),('homeTextTwo','Die veranstaltete Challenge beschränkt sich nicht auf Rudervereine allein. Jeder der dabei sein will, ist willkommen und findet seinen Platz. Teilnehmer aus aller Welt sind so willkommen.','The organized Challenge is not limited to rowing clubs alone. Everyone who wants to, is able to participate. Participants from all over the world are welcome.','La Serie Challenge no se limita solo a los clubes de remo. Todos los que quieran estar allí son bienvenidos y encuentran su lugar. Los participantes de todo el mundo son muy bienvenidos.','Challenge se ne ograničava samo na veslače. Svatko tko želi, a ima pristup Concept2 ergometru, iz bilo kojeg dijela svijata može učestvovati.'),('lastName','Nachname','Last name','last name','last name'),('loginBtn','Login','login','Login','Login'),('loginHeader','Um in die Reihung aufgenommen zu werden, benötigen wir von Ihnen diverse Daten','\r\nIn order to be included in the ranking, we require various data from you','\r\nIn order to be included in the ranking, we require various data from you','\r\nIn order to be included in the ranking, we require various data from you'),('logout','Log out','Log out','Log out','Log out'),('longname','Clubname','Clubname','Clubname','Clubname'),('mainpageBtn','Hauptseite','Main Page','Main Page','Main Page'),('male','männlich','male','masculino','muški'),('participantRankingBtn','30K Teilnehmer Ranking','30K Participants Ranking','30K Partícipe Clasificación','30K Rang lista natjecatelja'),('participantRankingHeadline','30K Personen Ranking Liste','30K person ranking list','30K Lista de clasificación personal','30K Rang lista pojedinačno'),('participantRankingSubheadline','Wählen Sie Ihre Filteroptionen','choose your filter options','Elija sus opciones de filtro','Odabrati filter'),('pdfAthletes','Athleten','athletes','Athletas','Natjecatelj'),('pdfCat','Kat.','cat.','Cat.','Kat.'),('pdfClass','Klasse','class','Clase','Kategorija'),('pdfClub','Club','club','Club','Klub'),('pdfEmail','Email','email','Email','Email'),('pdfMeter','Meter','meters','Metro','Metara'),('pdfName','Name','name','Nombre','Ime'),('pdfParticipant','Teilnehmer','participants','Participante','Natjecatelj'),('pdfParticipantCount','Anzahl','count','Numero','Broj'),('pdfRating','Wertung','scoring','Clasific.','Rangiranje'),('pdfRound','Runde','session','Periodo','Session'),('pdfShortcut','Kürzel','contraction','Corte','Kratica'),('pdfStatistics','Statistiken','statistics','Estadística','Statistika'),('pdfTotal','Gesamt','total','Total','Ukupno'),('rankingAll','Total','total','Total','Ukupno'),('rankingDownloadBtn','Lade pdf herunter','download pdf','Descaragar pdf','Downloadati PDF'),('rankingResult','Durchgänge','heats','Periodo','Session'),('rankingSequence','Sortierung','sorting','Clasificasión','Sortirati'),('rankingSequenceContent','Alphabetisch;Top Down;Kategorien','alphabetic;top down;categories','Alfabéticamente;Top Down;Categorías','abecedno; rang lista ukupno; po kategorijama'),('rankingSubheadline','Wählen Sie Ihre Filteroptionen','choose your filter options','Elija sus opciones de filtro','Odabrati filter'),('rankingYear','Jahr','year','año','Godina'),('registerAs','Registrieren als','Register as','Register as','Register as'),('resultPerWeekend','Ergebnis pro Wochenende','results per weekend','Resultado por se